    "Characterizing exposure and potential impacts of contaminants on seabirds nesting
    at South San Diego Bay Unit of the San Diego National Wildlife Refuge (Salt Works,
    San Diego Bay)",nt"tracking_summary": {ntt"total": 11,ntt"recent":
    2nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-07-27T22:41:47.537927",nt"name": "characterizing-exposure-and-potential-impacts-of-contaminants-on-seabirds-nesting-at-south",nt"isopen":
    false,nt"url": null,nt"notes": "In 2005, a two-year USFWS study (1261-1N74)
    was initiated to characterize contaminant exposure by seabirds that nest in colonies
    at the South Bay Salt Works, within the boundaries of the South San Diego Bay Unit
    of the San Diego Bay National Wildlife Refuge (NWR), CA. This study was conducted
    in response to observations by seabird colony monitors that black skimmers, in particular
    have an apparent high incidence of cracked and dented eggs, and posthatch chick
    mortality. Egg cracking and denting and chick mortality during and after hatching
    may be contaminant-related. Concerns were raised, that all of the seabird species
    nesting at the Salt Works may be experiencing some level of reproductive impairment
    related to contaminant exposure. This study entailed the collection and analysis
    of failed eggs of black skimmer, Caspian terns, elegant terns and federally endangered
    California least terns, and of forage fish that are potentially consumed by seabirds
    while nesting at the Salt Works. Fifteen skimmer eggs, five Caspian tern eggs, five
    elegant tern and ten least tern eggs, and 20 composite forage fish samples were
    collected at the Salt Works during the 2005 nesting season. All of the seabird eggs
    were evaluated for standard metrics and eggshell thickness. Five composite samples
    of least tern eggs (2 per sample) and individual eggs of black skimmer (N=15), Caspian
    tern (N=5) and elegant tern eggs (N=5) were submitted to laboratories under contract
    with the Service's Analytical Control Facility (catalog # 1040073) for chemical
    analysis. Composite whole body samples of forage fish were submitted for chemical
    analyses as well. Samples of forage fish included 5 composites of California killifish,
    3 composites of topsmelt, and 12 composites of longjaw mudsucker (gobiideae). Eggs
    and fish were analyzed for lipid content, metals, organochlorine pesticides, organotins,
    polychlorinated biphenyl (PCB) congeners, and polybrominated diphenyl ethers (PBDEs).",nt"license_title":
